import React from 'react';
import { Icon } from 'antd';
import { Row, Col } from 'antd';
import 'antd/dist/antd.css'
import './GameList.css';
import iconlv from '../../images/GameList/1@2x.png';

class GameList extends React.Component{
    render(){
        return(
            <div id="GameLiet">
                <div className="head">
                    <div className="new-game">New Games</div>
                    <div className="more">More</div>
                </div>
                <Row  className="game-list">
                    <Col span="5" className="game-img">
                        <img src="https://lh3.googleusercontent.com/WRTLHUBSdHGJkRRWhrnt_XIuoOPX7RFRwnO9U56l-OXVrFGfKQpEUyyuCEabadj3NX8=s180-rw" alt=""/>
                    </Col>
                    <Col span="14" className="game-text">
                        <div className="game-name">Geme Name</div>
                        <div className="game-lv">
                            <img src={iconlv} alt=""/>
                        </div>
                        <div className="introduction">简介</div>
                    </Col>
                    <Col  span="3" className="more-ico">
                        <Icon type="right" theme="outlined" twoToneColor="#5a7d93" />
                    </Col>
                </Row>
            </div>
        )
    }
}

export default GameList;
